import logo from './logo.svg';
import Register from './unprotected/register'
import Login from './unprotected/login'
import Navigation from './elements/navigation'
import Footer from './elements/footer'
import Dashboard from './protected/dashboard'
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams
} from "react-router-dom";
import { ProtectedRoute } from "./protected.route";
import { PreparedRoute } from "./prepared.route";
function App() {

  return <div>
    <Router>
    <Navigation/>
    <Link to={'/register'}>Register</Link>
    <div className="">
        <Switch>

          {/* Information */}
          <Route path="/terms"  component={Login}/>
          <Route path="/privacy"  component={Login}/>

          {/* Access / Unprotected */}
          <Route path="/register"  component={Register}/>
          <Route path="/signin"  component={LoginContainer}/>

          {/* Protected */}
          <ProtectedRoute exact path="/dashboard" component={Dashboard} />
          <Route path="/cv"  component={Register}/>
          <Route path="/skills"  component={Login}/>
          <Route path="/profile"  component={Login}/>
          <Route path="/entity"  component={Login}/>

          {/* Not Found */}
          <Route path="*" component={() => "404 NOT FOUND"}/>

        </Switch>      
    </div>

      <Footer/>
    </Router>  
    const LoginContainer = () => (
  <div className="container">
    <Route exact path="/" render={() => <Redirect to="/login" />} />
    <Route path="/login" component={Login} />
  </div>
)


  </div>
}

export default App;
